#include "http_parser.h"
#include <stdint.h>

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if (size == 0) return 0;

  enum http_errno err_no = (enum http_errno)(data[0] % 20); // Assuming there are 20 error codes
  const char *description = http_errno_description(err_no);

  return 0;
}

#include "http_parser.h"
#include <stdint.h>

#ifdef __cplusplus
extern "C" {
#endif

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if (size < 1) return 0;

  enum http_errno err_no = static_cast<enum http_errno>(data[0] % 21); // HTTP_ERRNO_MAX is 20
  const char *description = http_errno_description(err_no);

  return 0;
}

#ifdef __cplusplus
}
#endif
